import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";


const App = () => {
  return (
    <Router>
      <Switch>
          <Route path="/" >
            <Home />
          </Route>
      </Switch>
    </Router>
  );
};

export default App;
